import React, { useState } from "react";
import CurrencyInput from "./masks/CurrencyInput";

function App() {
  const [input, setInput] = useState(0);

  function handleChange(cleanValue, maskedValue) {
    setInput(cleanValue);
  }

  return (
    <div className="App">
      <CurrencyInput
        value={input}
        onChange={(cleanValue, maskedValue) => setInput(cleanValue)}
        className="test"
      />
    </div>
  );
}

export default App;
